import "./styles.css";

function App() {
  return (
  <header className="header">
  <div className="logo">
    <img
      src="logo.png"
      height="68"
      width="68"
      alt="Today I Learned Logo"
    />
    <h1>Today I Learned</h1>
  </div>

  <button className="btn btn-large btn-open">Share a fact</button>
  </header>)
}

function CategoryFilter() {
  return <aside>Category filter</aside>
}

export default App;
